import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

const App = () => {
  return (
    <div className="font-sans bg-gray-50 text-gray-800">
      <Navbar />

      {/* Main Content */}
      <section className="py-20 text-center bg-gradient-to-r from-blue-500 to-teal-500 text-white">
        <h2 className="text-4xl font-bold">Hello, I'm Ayush</h2>
        <p className="text-lg mt-4">I'm a Data Analyst and aspiring Data Scientist</p>
      </section>

      <section className="py-20 bg-gray-100">
        <h3 className="text-3xl font-semibold text-center">Skills & Experience</h3>
        <p className="text-center mt-4">Here, you can showcase your technical skills and experience.</p>
        {/* Add your skills here */}
      </section>

      <Footer />
    </div>
  );
};

export default App;
